import React, { Component } from 'react';
import $ from "jquery";
import { faUser } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";


import './../excss.css';
import './../Css/DivSect.css';
import LeftInformations from './LeftInformations';



class Imagesect extends Component {
  render() {
       // red
      return (
          <section className="sect red cf">
              <LeftInformations />
              <RightInfo />
          </section>
      )
    }
}

  // right info
  class RightInfo extends Component {
    render() {

      return (
        <div className="rightInfo flt_left">
          <div className="currentPage cf">
            <ul className="cf">
              <li crrPage="1" className="on" >1</li>
              <li crrPage="2">2</li>
              <li crrPage="3">3</li>
            </ul>
          </div>

          <div className="socialM cf">
            <ul className="cf">
              <li>
                <a href="/">
                  <span className="_skip">instagram</span>
                </a>
              </li>
              <li>
                <a href="/">
                  <span className="_skip">Call</span>
                </a>
              </li>
            </ul>
          </div>
        </div>
      )
    }

    clickMenu(){
      console.log(1)
    }
  }







  export default Imagesect;
